import React from "react";
import "./Navbar.css";
const Sukan = require("../img/logodukan.png");
import { BsCart4 } from "react-icons/bs";


const Navbar = () => {
  return (
    <>
      <navbar className="Navbar">
        <div className="content_left">
          <img src={Sukan} alt="Dukan_logo" />
          <input type="text" placeholder="Search Entire Store here..." className="SearchBar"/>
          <button className="serBtn">Search</button>
        </div>

        <div className="content_right">
          <div><BsCart4/></div>
        </div>
      </navbar>
    </>
  );
};

export default Navbar;
